    /* ==UserStyle==
@name           politico.com - 4/24/2023, 8:31:05 AM
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    A new userstyle
@author         Me
==/UserStyle== */
    @-moz-document domain("politico.com") {
        html,
        body,
        body div {
            background-color: #fbf8ef;
        }
        .page-content--story .page-content__row--story:first-child,
        .page-content__row--story {
            padding: 0;
        }
        section {
            padding: 0;
            margin: 0;
        }
        .story-text > ol,
        .story-text > ul,
        .story-text > p {
            font-family: "IBM Plex Serif";
        }
    }

/* ==UserStyle==
@name           news.ycombinator.com - 4/25/2023, 12:23:32 PM
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    A new userstyle
@author         Me
==/UserStyle== */
@-moz-document domain("news.ycombinator.com") {
    html {
        background-color: black;
    }
    code {
        font-family: "IBM Plex Mono";
        color: green;
    }
    table {
        background-color: #1d0826;
        color: #FFA500;
    }
    textarea {
        color: #f24b99;
        background-color: black;
    }
    input {
        background-color: purple;
        color: white;
    }
    .hnmore a:link,
    a:visited {
        color: #f24b99;
    }
    .pagetop a,
    .pagetop a:visited,
    .title a,
    .comhead a:link {
        color: #f24b99;
        font-size: 1.3em;
    }
    .commtext {
        font-family: "IBM Plex Serif";
        color: #f29d35;
        font-size: 1.3em;
    }
    .commtext a:link {
        color: purple
    }
    .score {
        color: #f29d35;
    }
}
